import {toast} from "react-toastify";

class AuthNotify {
    static NotAuthorized() {
        return toast.error('You are not authorized',
            {
                position: "top-center",
                autoClose: 2000,
                hideProgressBar: false,
                closeOnClick: true,
                pauseOnHover: true,
                draggable: true,
                theme: "colored",
            });
    }
}

export default AuthNotify;
